import { Link } from 'react-router-dom'
import React from 'react'
let HeadStyles = {
  div: {
    backgroundColor: 'gold',
    height: '60px',
    paddingTop: 40,
  },
  span: {
    fontWeight: 'bold',
    paddingLeft: '20px',
  },
}
export const Head = () => {
  return (
    <div style={HeadStyles.div}>
      <span style={{ fontWeight: 'bold', paddingLeft: '40px' }}>
        <Link to="/CreatePost">Create Post</Link>
      </span>
      <span style={{ fontWeight: 'bold', paddingLeft: '40px' }}>
        Recent Posts
      </span>
      <span style={{ fontWeight: 'bold', paddingLeft: '40px' }}>
        Profile Setting
      </span>
      <span
        style={{ fontWeight: 'bold', paddingRight: '50px', float: 'right' }}
      >
        Welcome To Application
      </span>
    </div>
  )
}
